Если ты живешь в Николаеве и еще не нашел свою вторую половину - мы постараемся тебе помочь. Мы хотим создать Центр Межличностных Отношений и Брака, где с помощью индивидуальных психологических тестов на совместимость мы сможем подобрать правильного человека для Тебя! Проект находится на стадии разработки, поэтому мы очень ценим Ваше сотрудничество и поддержку и будем рады услышать все Ваши пожелания! 

12 Октября 2010.

Дорогие друзья!

Приглашаем Вас в нашу группу „Давай Поженимся!" Техническое обеспечение психологических тестов находится на этапе разработки. Поэтому пока можно просто общаться! Приглашайте в группу своих друзей. Желаем всем приятного общения!! 

С Уважением к уже существующим участникам группы, страницы новых участников с профильным изображением следуующего характера будут удалены:
- сексуального (в нижнем белье или обнаженное тело);
- агрессивного (с изображением какого-либо вида оружия);
- пропагандирующего нездоровый образ жизни (с изображением сигарет, сигар или спиртных напитков);
- неадекватного (изображение актеров или других известных людей, животных, природы и других предметов и объектов);
- участников младше 18 лет.

Спасибо за понимание! Еще раз всем приятного общения!!
